Increment or create object in sub-array<p>I want to store/update statistics for each year. I have the following model</p>

<pre class="lang-js prettyprint-override"><code>{
  entityid: ObjectId,
  stats: [
    { year: 2018, value: 25 }
  ]
}
</code></pre>

<p>(This model is a bit simplified, in reality the year has also an array with months -> days -> hours. But the problem stays the same for the simplified model)</p>

<p>For updating I can simply use $inc like</p>

<pre class="lang-js prettyprint-override"><code>db.statistics.updateOne(
  {entityid, 'stats.year': 2018},
  {$inc: { 'stats.$.year': 1}}
) 
</code></pre>

<p>But now a problem arises when a new year begins because there will be no <code>{ year: 2019, value: 0 }</code> inside the stats array. Upsert can not really be used because of the positional operator $.</p>

<p>The current solution is to check the result of the update query above if we actually modified a document. If no changes were applied we execute a push to insert the array element for the new year and execute the update again.</p>

<p>The solution feels like a hack and produces some problem with race conditions where multiple objects are pushed for the same year, although this can be fixed easily. </p>

<p>Can the update/push operation be performed in one go? Or is there a better database model to store this information?</p>

