MongoDB | Graph Lookup with arrays<p>MongoDB - Trying to go a graph lookup with an array as a linking field. Seeing strange results that's difficult to comprehend.</p>

<p>My dataset:</p>

<pre><code>db.events.insertMany([
  { _id: 1, name: 'A', companies: ["X", "Y", "Z"] },
  { _id: 2, name: 'B', companies: ["X", "Y"] },
  { _id: 3, name: 'C', companies: ["X", "W"] },
  { _id: 4, name: 'D', companies: ["P","Q"] },
  { _id: 5, name: 'E', companies: ["P"] }
]);
</code></pre>

<p>My graph query:</p>

<pre><code>db.events.aggregate([
  { $match: { _id: 5 } },
  {
    $graphLookup: {
      from: 'events',
      startWith: '$companies', 
      connectFromField: 'companies',
      connectToField: 'companies', 
      maxDepth: 1, 
      as: 'colleagues'
    }
  }
]);
</code></pre>

<p>Expected Result:
